import React, { Fragment } from 'react'

function Temperature({numberOfDataSets, createTemperatureTags}) {
  return (
    <Fragment>
        <h2>Temperature</h2>
            {
                numberOfDataSets
            }

            {
                createTemperatureTags()
            }
    </Fragment>
  )
}

export default Temperature
